import React, { Component } from 'react'
import { UserConsumer } from './Contexts'

class ComponentC extends Component {
  render() {
    return (
      <UserConsumer>
        { username => {
            return <div>Hello {username}</div>
        }}

      </UserConsumer>
    )
  }
}

export default ComponentC
